import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import UserLayout from './UserLayout';
import AdminLayout from './AdminLayout';
import Home from './com/home';
import Location from './com/location';
import Hotel from './com/hotel';
import Feed from './com/feedback';
import AdminHome from './admin/AdminHome'; // Example admin component
import AdminLocationManagerHome from './admin/AdminLocationManagerHome'; // Example admin component
import AdminHotelManagerHome from './admin/AdminHotelManagerHome'; // Example admin component
import AdminUserSupporterHome from './admin/AdminUserSupporterHome'; // Example admin component
import AdminSchedulerHome from './admin/AdminSchedulerHome'; // Example admin component
import AdminTravelAgentHome from './admin/AdminTravelAgentHome'; // Example admin component
import AdminLogin from './admin/AdminLogin'; // Import the admin login component

function App() {
  return (
    <Router>
      <Routes>
        {/* User Routes */}
        <Route path="/home" element={<UserLayout><Home /></UserLayout>} />
        <Route path="/location" element={<UserLayout><Location /></UserLayout>} />
        <Route path="/hotel" element={<UserLayout><Hotel /></UserLayout>} />
        <Route path="/feed" element={<UserLayout><Feed /></UserLayout>} />

        {/* Admin Routes */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route path="/admin/home" element={<AdminLayout><AdminHome /></AdminLayout>} />
        <Route path="/admin/locationmanager/home" element={<AdminLayout><AdminLocationManagerHome /></AdminLayout>} />
        <Route path="/admin/hotelmanager/home" element={<AdminLayout><AdminHotelManagerHome /></AdminLayout>} />
        <Route path="/admin/usersupporter/home" element={<AdminLayout><AdminUserSupporterHome /></AdminLayout>} />
        <Route path="/admin/scheduler/home" element={<AdminLayout><AdminSchedulerHome /></AdminLayout>} />
        <Route path="/admin/travelagent/home" element={<AdminLayout><AdminTravelAgentHome /></AdminLayout>} />
      </Routes>
    </Router>
  );
}

export default app
